commits.content:
html,
body {
    min-width: 290px;
    color: #4d4e53;
    background-color: #ffffff;
    font-family: "Open Sans", Arial, sans-serif;
    line-height: 1.5;
}

#navbar {
    position: fixed;
    min-width: 290px;
    top: 0px;
    left: 0px;
    width: 300px;
    height: 100%;
    border-right: solid;
    border-color: rgba(0, 22, 22, 0.4);
}

header {
    color: black;
    margin: 10px;
    text-align: center;
    font-size: 2.5em;
    font-weight: thin;
}

#main-doc header {
    text-align: left;
    margin: 0px;
}

#navbar ul {
    height: 88%;
    padding: 0;
    overflow-y: auto;
    overflow-x: hidden;
}

#navbar li {
    color: #4d4e53;
    border-top: 1px solid;
    list-style: none;
    position: relative;
    width: 100%;
}

#navbar a {
    display: block;
    padding: 10px 30px;
    color: #4d4e53;
    text-decoration: none;
    cursor: pointer;
}

#main-doc {
    position: absolute;
    margin-left: 310px;
    padding: 20px;
    margin-bottom: 110px;
}

section article {
    color: #4d4e53;
    margin: 15px;
    font-size: 0.96em;
}

section li {
    margin: 15px 0px 0px 20px;
}

code {
    display: block;
    text-align: left;
    white-space: pre-line;
    position: relative;
    word-break: normal;
    word-wrap: normal;
    line-height: 2;
    background-color: #f7f7f7;
    padding: 15px;
    margin: 10px;
    border-radius: 5px;
}

table {
    border-collapse: collapse;
    width: 100%;
}
th, td {
    border: 1px solid black;
    padding: 8px;
    text-align: left;
}
th {
    background-color: #f2f2f2;
}

.C_color {
    color: #ABBBCE;
    font-weight: 700;
}

.Cpp_color {
    background-image: linear-gradient(to right, #659BD3, #004482);
    color: #FFFFFF;
    font-weight: 700;
}

.Csharp_color {
    background: #866AE2;
    color: #FFFFFF;
    font-weight: 700;
}

.Java_color {
    color: #007396;
    font-weight: 700;
}

.Rust_color {
    color: #000000;
    font-weight: 700;
}

.JS_color {
    color: #f7df1e;
    font-weight: 700;
}

.Ruby_color {
    color: #CC342D;
    font-weight: 700;
}

.PHP_color {
    color: #4F5D95;
    font-weight: 700;
}

.Perl_color {
    color: #ff481e;
    font-weight: 700;
}

.Fortran_color {
    color: #0073E6;
    font-weight: 700;
}

.R_color {
    color: #1B5EAF;
    font-weight: 700;
}

.Scala_color {
    color: #DB3431;
    font-weight: 700;
}

.PS_color {
    color: #012456;
    font-weight: 700;
}

.Bash_color {
    color: #3E474A;
    font-weight: 700;
}

.Mercury_color {
    color: #6A6A6A;
    font-weight: 700;
}

.Pyt_color {
    display: inline-block;
    position: relative;
    color: #FFE464;
    font-weight: 700;
}

.Pyt_color::before {
    content: attr(data-char);
    position: absolute;
    overflow: hidden;
    color: #306998;
    font-weight: 700;
}

.Has_color {
    display: inline-block;
    position: relative;
    color: #8F4E8B;
    font-weight: 700;
}

.Has_color::before {
    content: attr(data-char);
    position: absolute;
    overflow: hidden;
    color: #5E5086;
    font-weight: 700;
}

.Lisp_color {
    background-color: #000000;
    color: #ffffff;
    font-weight: 700;
}

.Erlang_color {
    color: #A90432;
    font-weight: 700;
}

.Go_color {
    color: #79D4FD;
    font-weight: 700;
}

.Delphi_color {
    background-image: linear-gradient(to right, #F32232, #A0061A);
    color: #FFFFFF;
    font-weight: 700;
}

@media only screen and (max-width: 815px) {
    /* For mobile phones: */
    #navbar ul {
        border: 1px solid;
        height: 207px;
    }

    #navbar {
        background-color: white;
        position: absolute;
        top: 0;
        padding: 0;
        margin: 0;
        width: 100%;
        max-height: 275px;
        border: none;
        z-index: 1;
        border-bottom: 2px solid;
    }

    #main-doc {
        position: relative;
        margin-left: 0px;
        margin-top: 270px;
    }
}

@media only screen and (max-width: 400px) {
    #main-doc {
        margin-left: -10px;
    }

    code {
        margin-left: -20px;
        width: 100%;
        padding: 15px;
        padding-left: 10px;
        padding-right: 45px;
        min-width: 233px;
    }
}
